<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <link rel="stylesheet" href="css/leaflet-measure.css">
        <style>
        html, body, #map {
            width: 100%;
            height: 100%;
            padding: 0;
            margin: 0;
        }
        </style>
        <title>Services</title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script src="js/leaflet-measure.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[-21.962076172110496,114.13045202257571],[-21.947886407701322,114.15575886777904]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var autolinker = new Autolinker({truncate: {length: 30, location: 'smart'}});
        var measureControl = new L.Control.Measure({
            position: 'topleft',
            primaryLengthUnit: 'meters',
            secondaryLengthUnit: 'kilometers',
            primaryAreaUnit: 'sqmeters',
            secondaryAreaUnit: 'hectares'
        });
        measureControl.addTo(map);
        document.getElementsByClassName('leaflet-control-measure-toggle')[0]
        .innerHTML = '';
        document.getElementsByClassName('leaflet-control-measure-toggle')[0]
        .className += ' fas fa-ruler';
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        map.createPane('pane_SatelliteMap_0');
        map.getPane('pane_SatelliteMap_0').style.zIndex = 400;
        var layer_SatelliteMap_0 = L.tileLayer('https://www.google.cn/maps/vt?lyrs=s@189&gl=cn&x={x}&y={y}&z={z}', {
            pane: 'pane_SatelliteMap_0',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 18
        });
        layer_SatelliteMap_0;
        map.addLayer(layer_SatelliteMap_0);
        map.createPane('pane_Exmouth_ServicesGEO_CombinedServices_1');
        map.getPane('pane_Exmouth_ServicesGEO_CombinedServices_1').style.zIndex = 401;
        var img_Exmouth_ServicesGEO_CombinedServices_1 = 'data/Exmouth_ServicesGEO_CombinedServices_1.png';
        var img_bounds_Exmouth_ServicesGEO_CombinedServices_1 = [[-21.957322901968247,114.13664622469082],[-21.953196699829117,114.14282785218094]];
        var layer_Exmouth_ServicesGEO_CombinedServices_1 = new L.imageOverlay(img_Exmouth_ServicesGEO_CombinedServices_1,
                                              img_bounds_Exmouth_ServicesGEO_CombinedServices_1,
                                              {pane: 'pane_Exmouth_ServicesGEO_CombinedServices_1'});
        bounds_group.addLayer(layer_Exmouth_ServicesGEO_CombinedServices_1);
        map.addLayer(layer_Exmouth_ServicesGEO_CombinedServices_1);
        map.createPane('pane_Exmouth_ServicesGEO_Comms_2');
        map.getPane('pane_Exmouth_ServicesGEO_Comms_2').style.zIndex = 402;
        var img_Exmouth_ServicesGEO_Comms_2 = 'data/Exmouth_ServicesGEO_Comms_2.png';
        var img_bounds_Exmouth_ServicesGEO_Comms_2 = [[-21.957322901968247,114.13664622469082],[-21.953196699829117,114.14282785218094]];
        var layer_Exmouth_ServicesGEO_Comms_2 = new L.imageOverlay(img_Exmouth_ServicesGEO_Comms_2,
                                              img_bounds_Exmouth_ServicesGEO_Comms_2,
                                              {pane: 'pane_Exmouth_ServicesGEO_Comms_2'});
        bounds_group.addLayer(layer_Exmouth_ServicesGEO_Comms_2);
        map.addLayer(layer_Exmouth_ServicesGEO_Comms_2);
        map.createPane('pane_Exmouth_ServicesGEO_Electrical_3');
        map.getPane('pane_Exmouth_ServicesGEO_Electrical_3').style.zIndex = 403;
        var img_Exmouth_ServicesGEO_Electrical_3 = 'data/Exmouth_ServicesGEO_Electrical_3.png';
        var img_bounds_Exmouth_ServicesGEO_Electrical_3 = [[-21.957322901968247,114.13664622469082],[-21.953196699829117,114.14282785218094]];
        var layer_Exmouth_ServicesGEO_Electrical_3 = new L.imageOverlay(img_Exmouth_ServicesGEO_Electrical_3,
                                              img_bounds_Exmouth_ServicesGEO_Electrical_3,
                                              {pane: 'pane_Exmouth_ServicesGEO_Electrical_3'});
        bounds_group.addLayer(layer_Exmouth_ServicesGEO_Electrical_3);
        map.addLayer(layer_Exmouth_ServicesGEO_Electrical_3);
        map.createPane('pane_Exmouth_ServicesGEO_Hydraulics_4');
        map.getPane('pane_Exmouth_ServicesGEO_Hydraulics_4').style.zIndex = 404;
        var img_Exmouth_ServicesGEO_Hydraulics_4 = 'data/Exmouth_ServicesGEO_Hydraulics_4.png';
        var img_bounds_Exmouth_ServicesGEO_Hydraulics_4 = [[-21.957322901968247,114.13664622469082],[-21.953196699829117,114.14282785218094]];
        var layer_Exmouth_ServicesGEO_Hydraulics_4 = new L.imageOverlay(img_Exmouth_ServicesGEO_Hydraulics_4,
                                              img_bounds_Exmouth_ServicesGEO_Hydraulics_4,
                                              {pane: 'pane_Exmouth_ServicesGEO_Hydraulics_4'});
        bounds_group.addLayer(layer_Exmouth_ServicesGEO_Hydraulics_4);
        map.addLayer(layer_Exmouth_ServicesGEO_Hydraulics_4);
        var baseMaps = {};
        L.control.layers(baseMaps,{"Exmouth_ServicesGEO_Hydraulics": layer_Exmouth_ServicesGEO_Hydraulics_4,"Exmouth_ServicesGEO_Electrical": layer_Exmouth_ServicesGEO_Electrical_3,"Exmouth_ServicesGEO_Comms": layer_Exmouth_ServicesGEO_Comms_2,"Exmouth_ServicesGEO_CombinedServices": layer_Exmouth_ServicesGEO_CombinedServices_1,"Satellite Map": layer_SatelliteMap_0,},{collapsed:false}).addTo(map);
        setBounds();
        L.ImageOverlay.include({
            getBounds: function () {
                return this._bounds;
            }
        });
        </script>
    </body>
</html>
